import Customers from 'components/Customers/Customers';
import css from './Reviews.module.css';

export default function Reviews() {
  return (
    <>
      <section className={css.reviewsSection}>
        <div className={css.reviews}>
          <h1 className={css.reviewsTitle}>
            <span className={css.pinkText}>StellarLikes</span> Reviews
          </h1>
          <p className={css.reviewsText}>
            Don't settle for fake users. StellarLikes delivers followers, likes,
            and views from real users, delivered instantly. At the lowest
            possible prices.
          </p>
        </div>
      </section>
      <Customers />
    </>
  );
}
